const Home = () => {
    const [filterActive, setFilterActive] = useState(false);
    return (
        <>
            <AppHeader />
            {/* <SearchFilter setFilterActive={setFilterActive} /> */}
            {!filterActive && <DIsplayItem />}
            <AppFooter />
        </>
    )
}

export default Home;
